import React from "react";
import "./index.css";
import Header from "../Header";
import Footer from "../Footer";

function Layout({ children }) {
  return (
    <div className="container">
      <Header />
      <main className="content">
        <section >{children}</section>
      </main>
      <Footer />
    </div>
  );
}

export default Layout;
